#Uses premade bootstrap template and displays graph with controls

from bokeh.sampledata.autompg import autompg
import panel as pn
from bokeh.models import CustomJS
import hvplot.pandas

#add custom css for main panel here. append css to panel to use the css class
css = '''
.bk.panel-widget-box-custom {
  background: #f0f0f0;
  border-radius: 5px;
  border: 1px black solid;
}
'''
pn.extension(sizing_mode = 'stretch_width',raw_css=[css])

#premade bootstrap template
bootstrap = pn.template.BootstrapTemplate(title='flexible *reactive* functions with bootstrap template',site="Dashboard",header_background="#56e3da",logo="data:image/png;base64,")

columns = list(autompg.columns[:-2])
x = pn.widgets.Select(value='mpg', options=columns, name='x')
y = pn.widgets.Select(value='hp', options=columns, name='y')
color = pn.widgets.ColorPicker(name='Color', value='#AA0505')
button = pn.widgets.Button(name='Main menu', button_type='primary')

#custom js for button functionality
url="""
window.location.href="http://localhost:5006/"
"""

#bind controls to graphs. @pn.depends will rerender graph if depending variables is changed
@pn.depends(x, y, color)
def plot(xval, yval, colorval):
    return autompg.hvplot.scatter(xval, yval, c=colorval)

#add controls to dashboard
# bootstrap.sidebar.append(css_classes=['panel-side-box'])
bootstrap.sidebar.append(button)
bootstrap.sidebar.append(x)
bootstrap.sidebar.append(y)
bootstrap.sidebar.append(color)

# #run custom js on click
# button.js_on_click(code="""
# document.getElementById("sidebar").style = "border: 1px black solid;"
# """)
button.js_on_click(code=url)

#add graphs to dashboard
bootstrap.main.append(
    pn.Row(
        pn.Card(pn.bind(plot, x, y,color)),
        css_classes=['panel-widget-box-custom']
    )
)
bootstrap.servable()